    def __init__(self, name):
        self.name = name

    def submit_data(self, data):
        if self.validate_data(data):
            print(f"Submission successful for {self.name}")
            return True
        else:
            print(f"Submission failed for {self.name}")
            return False

    def validate_data(self, data):
